import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {

  let name = 'France';
  name = 'Celynne';
  let profile ={
       name: 'France',
       age: 23,

      };
  return (

    <div className="App">
      <Header />
      <main>
        <h1>Hello, I'm {profile.name} {profile.age} years old</h1>
        <img src={logo}></img>
      </main>
      <Footer />

    </div>
  );
}

export default App;
